import React from 'react';
import logo from '../../images/logo.png';
import './Header.css';

const Header = () => {
    return (
        <div className="header-img">
            <img src={logo} alt=""/>
            <nav><a href="/shop">Shop</a><a href="/review">Review</a><a href="/man"></a></nav>
        </div>
    );
};

export default Header;
